import React, {Component, useState, useEffect} from 'react'

class lista extends Component{
  constructor(props){
    super(props)

    this.receiveData = this.receiveData.bind(this)
    this.RcvDT = this.RcvDT.bind(this)
  }

  RcvDT = () => {
    useEffect(() =>{
      fetchItems()
    }, [])

    const [items, setItems] = useState([])


    const fetchItems = async() => {
      const data = await fetch(this.receiveData())


      const items = await data.json()
      console.log(items)
      setItems(items)
    }

    return (
      <div>
        {items.map(item => (
          <h1>item.description</h1>
        ))}
      </div>
    )    
  }


  receiveData = () => {
    let listaObj = 
      [
        {
        description: "kaio Nunes",
        LastBoa: "0",
        createdAt: "2019-07-22"
        },
        {
        description: "Chico Picole",
        LastBoa: "1",
        createdAt: "2019-07-22"
        }
      ]    
    return console.log(listaObj)
  }  

  render(){
    return (
      <div className='sort-form'>
        <h2><i className="fa fa-user" aria-hidden="true"></i> Lista</h2>
        {this.RcvDT}
      </div>
    )
  }
}
export default lista
